Video and photos by @amivitale.  Hey it’s World Elephant Day coming up this week, so I am thrilled to share the new short film "Shaba" by my good friend and NatGeo colleague @amivitale. The film tells the extraordinary story of Reteti Elephant Sanctuary (@r.e.s.c.u.e)'s first matriarch. The film is now online and your ticket sales will go directly to support the elephants and their incredible keepers. It is available on-demand from today until August 31. Visit shabafilm.org or go to @amivitale and follow the link in her profile to watch today.

Reteti elephant sanctuary, @r.e.s.c.u.e is the first ever community-owned elephant sanctuary in Africa. Orphans arrive here as a result of human-elephant conflict, drought-related issues and some cases of poaching. It provides a safe place for injured elephants to heal and later be returned back to the wild.

